import React from 'react';
import './Home.css';
import Navbar from '../../components/Navbar/Navbar';

function Home() {
    return (
        <div>
            <Navbar className="Navbar" />
            <div className="Introduction">
                <p id="Hi">Hi! My name is</p>

            </div>
        </div>
    );
}

export default Home;
